package Fresh;

public class Constructoroverloading_Examples {

	
		// TODO Auto-generated method stub
		
		int a ;
		int b;
		
		Constructoroverloading_Examples()
		{
			a=10;
			b=20;
			System.out.println(a+b);
			
		}
		
		Constructoroverloading_Examples(int x ,int y)
		{
			int a=x;
			int b=y;
			System.out.println(a+b);
			
		}
		public static void main(String[] args) {
		Constructoroverloading_Examples OEE = new Constructoroverloading_Examples();
		
	}
	
		
		//Extends & Class(SIngle/Hirearchical & multivel )
		//Multiple/Hybrid (Implements/interface)

}















